import { Box, Button, Grid, Menu } from "@mui/material";
import React, { useState } from "react";
import Paper from "@mui/material/Paper";
import CalendarMonthIcon from "@mui/icons-material/CalendarMonth";
import WaterDropIcon from "@mui/icons-material/WaterDrop";
import EventIcon from "@mui/icons-material/Event";
import OpacityIcon from "@mui/icons-material/Opacity";
import AccountBalanceWalletIcon from "@mui/icons-material/AccountBalanceWallet";
import CurrencyRupeeIcon from "@mui/icons-material/CurrencyRupee";
import ModeEditRoundedIcon from "@mui/icons-material/ModeEditRounded";
import { blue } from "@mui/material/colors";
import Menubar from "./Menu";
import { Outlet } from "react-router-dom";
import { Link } from "react-router-dom";
import Modal from "@mui/material/Modal";
import BloodtypeIcon from "@mui/icons-material/Bloodtype";
import TextField from "@mui/material/TextField";

export default function Watertracker() {
  const [open, setOpen] = React.useState(false);
  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  const [month, setMonth] = useState("0");
  const [day, setDay] = useState("0");
  const [liters, setLiters] = useState("0");
  const [balance, setBalance] = useState("0");
  // const addWatercan(){

  // }
  return (
    <Grid style={{ background: "#e6e8f7" }}>
      <p style={{ textAlign: "left" }}>
        <Menubar />
      </p>
      <Box sx={{ height: 600, width: 500, margin: 10, marginLeft: 50 }}>
        <Grid container style={{ margin: 20 }}>
          <Grid item xs={6}>
            <Link to="calender">
              <Paper elevation={3} style={{ padding: 5, margin: 10 }}>
                <CalendarMonthIcon sx={{ fill: "deeppink", marginRight: 30 }} />
                <div style={{ display: "flex", paddingLeft: 120 }}>
                  <p>{month}</p>
                  <p>
                    {" "}
                    <WaterDropIcon sx={{ fill: "blue" }} />
                  </p>
                </div>
                <p>This month</p>
              </Paper>
            </Link>
          </Grid>

          <Grid item xs={6}>
            <Paper elevation={3} style={{ padding: 5, margin: 10 }}>
              <EventIcon sx={{ fill: "deeppink", marginRight: 30 }} />
              <div style={{ display: "flex", paddingLeft: 120 }}>
                <p>{day}</p>
                <p>
                  <WaterDropIcon sx={{ fill: "blue" }} />
                </p>
              </div>
              <p>Day</p>
            </Paper>
          </Grid>
        </Grid>
        <Grid container style={{ margin: 20 }}>
          <Grid item xs={6}>
            <Paper elevation={3} style={{ padding: 5, margin: 10 }}>
              <OpacityIcon sx={{ fill: "blue", marginRight: 30 }} />
              <div style={{ display: "flex", paddingLeft: 120 }}>
                <p>{liters}</p>
                <h5 style={{ color: blue }}>L</h5>
              </div>
              <p>Person/Day</p>
            </Paper>
          </Grid>
          <Grid item xs={6}>
            <Link to="balance">
              <Paper elevation={3} style={{ padding: 5, margin: 10 }}>
                <AccountBalanceWalletIcon
                  sx={{ fill: "green", marginRight: 30 }}
                />
                <div style={{ display: "flex", paddingLeft: 120 }}>
                  <p>{balance}</p>
                  <p>
                    <CurrencyRupeeIcon sx={{ fill: "green" }} />
                  </p>
                </div>
                <p>Balance</p>
              </Paper>
            </Link>
          </Grid>
        </Grid>

        <Button
          style={{
            background: "rgb(35 137 219)",
            color: "white",
            borderRadius: 50,
          }}
        >
          <WaterDropIcon />
          WATER CAN
        </Button>

        <Button
          style={{
            background: "rgb(35 137 219)",
            color: "white",
            borderRadius: "50%",
            margin: 10,
          }}
          onClick={handleOpen}
        >
          <ModeEditRoundedIcon />
        </Button>
        <Modal
          open={open}
          onClose={handleClose}
          aria-labelledby="modal-modal-title"
          aria-describedby="modal-modal-description"
        >
          {" "}
          <Box>
            <Paper style={{ margin: "100px 500px 0 500px" }}>
              <Button
                style={{
                  background: "rgb(35 137 219)",
                  borderRadius: "50%",
                  height: 45,
                  width: 25,
                }}
              >
                {" "}
                <BloodtypeIcon sx={{ color: "white" }} />
              </Button>

              <p>
                {" "}
                <TextField label="Can capacity" />
              </p>
              <p>
                {" "}
                <TextField label="Price per can" />
              </p>
              <p>
                <TextField
                  label="Date"
                  defaultValue={new Date().toDateString()}
                />
              </p>
              <Button
                style={{ background: "rgb(35 137 219)", marginBottom: 20 }}
              >
                <div style={{ display: "flex", height: 50, marginTop: -17 }}>
                  <p>
                    <BloodtypeIcon sx={{ fill: "white" }} />
                  </p>
                  <h4 style={{ color: "white", width: 100 }}>WATER CAN</h4>
                </div>
              </Button>
            </Paper>
          </Box>
        </Modal>
      </Box>
      {<Outlet />}
    </Grid>
  );
}
